import { BrowserRouter } from "react-router-dom";
import Landing from './Component/Landing'
import './App.css';

export default class App extends Component {
  render() {
    return (
      <div className="App">
        <BrowserRouter >
          <Landing />
        </BrowserRouter>
      </div>
    )
  }
}
